import styled from "styled-components";

export const LoginImage = styled.img`
  width: 20px;
`;

export const Container = styled.div`
  display:flex  
  align-items: center;
  justify-content: center;
  flex-direction: column
`;

export const ButtonContainer = styled.div`
  display: flex;
  align-items: center;
`;
